// articles is a prop, property, so that we can reuse this component with 
// different inputs and make different lists
import { Link } from 'react-router-dom';
import FinBasics from '../pages/finBasics';

const FinBasicsList = ({ finArticles }) => {
    return (
        <>
        {finArticles.map(article => 
            <div key={article.name} className ="fin-article-list-item">
                <h3><Link to={`/financial-basics/${article.name}`}>{article.title}</Link></h3>
                <p>{article.content[0].substring(0, 150)}...</p>
            </div>
        )}
        </>
    );
}   

export default FinBasicsList;
